(function() {
    'use strict';
    const SCRIPTNAME = GM_info.script.name;
    const DIMG = 'data:image/png;base64,'
    const DIMGP = 'data:image/png;base64,'
    const PMIMG = 'data:image/png;base64,'
    const PMIMGP = 'data:image/png;base64,'
    const PMIMG2 = 'data:image/png;base64,'
    const PMIMG2P = 'data:image/png;base64,'
    const SERVERLIST = '%5Bb%5D%5Bsize%3D85%5DIn%20case%20you%20were%20not%20aware%2C%20editors%20can%20now%20use%20Discord%20to%20communicate%20with%20the%20editing%20community%2E%20Here%20is%20a%20list%20of%20servers%20that%20you%20can%20join%3A%0A%0AGlobal%7F%26%7FMapRaid%7F%2D%7F%5Burl%5Dhttps%3A%2F%2Fdiscord%2Egg%2FYEtgvCN%5B%2Furl%5D%0AWaze%7FUSA%7F%2D%7F%5Burl%5Dhttps%3A%2F%2Fdiscord%2Egg%2FQ3YPQC6%5B%2Furl%5D%0AGreat%7FLakes%7FRegion%7F%28GLR%29%7F%2D%7F%5Burl%5Dhttps%3A%2F%2Fdiscord%2Eme%2Fwazeglr%5B%2Furl%5D%0AMid%7FAtlantic%7FRegion%7F%28MAR%29%7F%2D%7F%5Burl%5Dhttps%3A%2F%2Fgoo%2Egl%2FE5CKDk%5B%2Furl%5D%0ANew%7FEngland%7FRegion%7F%28NER%29%7F%2D%7F%5Burl%5Dhttps%3A%2F%2Fgoo%2Egl%2Fforms%2FX24ENSZ6ANw2sQpV2%5B%2Furl%5D%0ANortheast%7FRegion%7F%28NOR%29%7F%2D%7F%5Burl%5Dhttps%3A%2F%2Fdiscord%2Eme%2FNorthEast_Region%5B%2Furl%5D%0ANorthwest%7FRegion%7F%28NWR%29%7F%2D%7F%5Burl%5Dhttps%3A%2F%2Fdiscord%2Eme%2Fwazenwr%5B%2Furl%5D%0APlains%7FRegion%7F%28PLN%29%7F%2D%7F%5Burl%5Dhttp%3A%2F%2Fwww%2Ediscord%2Eme%2Fwazepln%5B%2Furl%5D%0ASouth%7FAtlantic%7FRegion%7F%28SAT%29%7F%2D%7F%5Burl%5Dhttps%3A%2F%2Fgoo%2Egl%2FyjKKgv%5B%2Furl%5D%0ASouth%7FCentral%7FRegion%7F%28SCR%29%7F%2D%7F%5Burl%5Dhttps%3A%2F%2Fdiscord%2Eme%2Fwaze_scr%5B%2Furl%5D%0ASoutheast%7FRegion%7F%28SER%29%7F%2D%7F%5Burl%5Dhttps%3A%2F%2Fdiscord%2Eme%2Fsoutheast%5B%2Furl%5D%0ASouthwest%7FRegion%7F%28SWR%29%7F%2D%7F%5Burl%5Dhttps%3A%2F%2Fdiscord%2Egg%2FtwxnqnU%5B%2Furl%5D%0ATerritories%7F%28ATR%29%7F%2D%7F%5Burl%5Dhttps%3A%2F%2Fdiscord%2Egg%2FVup2VEA%5B%2Furl%5D%0AAustralia%7F%2D%7F%5Burl%5Dhttps%3A%2F%2Fdiscord%2Eme%2Fwazeaustralia%5B%2Furl%5D%0A%5B%2Fsize%5D%5B%2Fb%5D'
    const monthNames = ["January", "February", "March", "April", "May", "June", "July", "August", "September", "October", "November", "December"];
    const d = new Date();
    var mm = monthNames[d.getMonth()];
    var today = new Date();
    var dd = today.getDate();
    var yyyy = today.getFullYear();

    if(dd<10) {
        dd = '0'+dd
    }
    if(mm<10) {
        mm = '0'+mm
    }
    today = mm +' '+ dd + ', ' + yyyy;
    const PMLink = 'https://www.waze.com/forum/ucp.php?i=pm&mode=compose&subject=Happy Birthday ('+ today +')&message=' + SERVERLIST + '&username_list='
    const link = document.createElement('a');
    link.href = "#";
    const a = link
    const arrBirthdayList = [];
    $( 'div#page-body p').eq( 3 ).find( 'strong a' ).each( function( i ){ arrBirthdayList[ i ] = $( this ).text(); } );
    function BirthdayButton() {
        let pdiv = document.createElement('div');
        pdiv.id = 'P-IMG';
        $('#wrap').after(pdiv);
        let pimg = document.createElement('img');
        pimg.id = 'PM-IMG';
        pimg.src = PMIMG;
        pimg.onmouseout = function() {
            pimg.src = PMIMG
        }
        pimg.onmouseover = function () {
            pimg.src = PMIMGP
        }
        pdiv.appendChild(pimg);
        document.getElementById('P-IMG').appendChild(pimg);
        $('#PM-IMG').wrap(a);
        pimg.onclick = function() {
            let copyText = arrBirthdayList.join( '\n' );
            console.info('Birthdays for PM: \n\n'+copyText);
            //alert('Opening PM window');
            let PMList = PMLink + arrBirthdayList.slice(0, 20).join('%0A%0D');
            window.open(PMList);
            if(arrBirthdayList.length > 20){
                let PMList2 = PMLink + arrBirthdayList.slice(21, 40).join('%0A%0D');
                window.open(PMList2);
            }
        }
        var dimg = document.createElement('img')
        dimg.id = 'DS-IMG'
        dimg.src = DIMG
        dimg.onmouseout = function() {
            dimg.src = DIMG
        }
        dimg.onmouseover = function () {
            dimg.src = DIMGP
        }
        document.body.appendChild(dimg);
        document.getElementById('P-IMG').appendChild(dimg);
        $('#DS-IMG').wrap(a);
        $('#wrap').after(pdiv);
        dimg.onclick = function() {
            var copyText = 'Birthdays for ' + ( new Date() ).toLocaleDateString( 'en-us', { month: 'long', day: 'numeric', year: 'numeric' } ) + ':\n\n@' + arrBirthdayList.join( '\n@' ) + '\n\nHappy Birthday everyone!';
            var copied = $('<textarea rows="1" cols="1">').val(copyText).appendTo('body').select();
            document.execCommand('copy');
            console.log( copyText );
            alert('Birthdays Copied for Discord')
        }
    }
    function bootstrap(tries = 1) {
        if ((/forum/.test(location.href)) && $("h3:contains(Birthdays)").length > 0) {
            BirthdayButton();
        } else if (tries < 1000) {
            setTimeout(function () {bootstrap(tries++);}, 200);
        }
    }
    bootstrap();
})();
